import React, { Component } from 'react';
import TopListItem from './TopListItem';

import './TopList.sass';

class TopList extends Component {
  render() {
    return (
      <nav className="top-content-nav">
        <ul className="top-list">
          <TopListItem>Мои проекты</TopListItem>
          <TopListItem>Чужие проекты</TopListItem>
          <TopListItem>Сниппеты</TopListItem>
          <TopListItem>Компоненты</TopListItem>
          
          <li className="top-list__item">
            <button className="top-list__button">+</button>            
          </li>
        </ul>
        
      </nav>
    );
  }
}

export default TopList;
